import React from "react";
import './Project.css';
import Project_data from './../project/Project.json';
const bg={
    background:'transparent',

}
function Project(){
    return (
        <div className="row">
            {
                Project_data.map((element,index) => {
                    return(
                            <div className="col-md-6">
                                <div className="card" style={bg}>
                                    <div className="card-body">
                                        <div className="card-title" key={index}>
                                            {element.name}
                                        </div>
                                        <div className="card-text">
                                            {element.about}
                                        </div>
                                        <div className="card-text">
                                            {element.about1}
                                        </div>
                                        <div className="card-text">
                                            {element.about2}
                                        </div>
                                        <div className="card-link">
                                            <a href={element.github} className="btn btn-outline-primary">Github</a>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        );
                })
            }
        </div>
    )
}
export default Project;
